import React, { useState } from 'react';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import ItemsPage from './components/ItemsPage';
import './App.css';

function App() {
  const [currentPage, setCurrentPage] = useState('dashboard');

  const renderPage = () => {
    switch (currentPage) {
      case 'dashboard':
        return <Dashboard />;
      case 'items':
        return <ItemsPage />;
      case 'users':
        return (
          <div className="page-content">
            <div className="page-header">
              <h1>Users</h1>
              <p>Manage user accounts and permissions</p>
            </div>
            <div className="card">
              <p>Users management coming soon...</p>
            </div>
          </div>
        );
      case 'settings':
        return (
          <div className="page-content">
            <div className="page-header">
              <h1>Settings</h1>
              <p>Configure your Inkwell application</p>
            </div>
            <div className="card">
              <p>Settings panel coming soon...</p>
            </div>
          </div>
        );
      case 'api':
        return (
          <div className="page-content">
            <div className="page-header">
              <h1>API Documentation</h1>
              <p>Explore and test your API endpoints</p>
            </div>
            <div className="card">
              <h2>Available Endpoints</h2>
              <ul>
                <li><strong>GET /api/health</strong> - Health check</li>
                <li><strong>GET /api/items</strong> - Get all items</li>
                <li><strong>POST /api/items</strong> - Create a new item</li>
                <li><strong>GET /api/items/&#123;id&#125;</strong> - Get specific item</li>
                <li><strong>PUT /api/items/&#123;id&#125;</strong> - Update item</li>
                <li><strong>DELETE /api/items/&#123;id&#125;</strong> - Delete item</li>
                <li><strong>GET /api/settings/&#123;key&#125;</strong> - Get setting</li>
                <li><strong>POST /api/settings</strong> - Set setting</li>
                <li><strong>GET /api/users</strong> - Get all users</li>
                <li><strong>GET /api/users/&#123;id&#125;</strong> - Get specific user</li>
              </ul>
              <p>
                <a href="/docs" target="_blank" rel="noopener noreferrer">
                  View Interactive API Documentation
                </a>
              </p>
            </div>
          </div>
        );
      default:
        return <Dashboard />;
    }
  };

  return (
    <div className="App">
      <Header />
      <Sidebar currentPage={currentPage} onPageChange={setCurrentPage} />
      <main className="main-content">
        {renderPage()}
      </main>
    </div>
  );
}

export default App;
